pragma solidity ^0.5.0;
pragma experimental ABIEncoderV2;

contract SimpleStorage {
    struct Song {
        address payable owner;
        string Title;
        uint256 Price;
        //int256 downloads;
        string Date;
        string SongHash; //SongHash
        string SongArtist;
        uint256 genreId;
       // string CoverImage;
    }

    //events
    event SongAdded(address songowner, Song song);
    event SongUpdated(address owner, Song song, string dateUpdated);
    event SongDeleted(Song song, string dateDeleted);
    event DownloadSong(
        address owner,
        address buyer,
        Song song,
        string dateDownloaded
    );

    Song[] allSongs;
    mapping(string => Song) songStruct;

    function addSong(
        string memory _Title,
        uint256 _Price,
        string memory _Date,
        string memory _SongHash,
        string memory _SongArtist,
        uint256 _GenreId
        //string memory _CoverImage
    ) public {
        Song memory newSong;
        newSong.owner = msg.sender;
        newSong.Title = _Title;
        newSong.SongArtist = _SongArtist;
        newSong.Price = _Price;
        newSong.Date = _Date;
        //newSong.downloads = 0;
        newSong.genreId = _GenreId;
        newSong.SongHash = _SongHash;
        //newSong.CoverImage = _CoverImage;

        allSongs.push(newSong);
        //songStruct[_SongHash] = newSong;

        //emit songAdded event
        emit SongAdded(msg.sender, newSong);
    }

    function downloadSong(Song memory song, string memory date) public payable {
        require(
            msg.value >= ((song.Price / (10**10)) * 1 ether),
            "Not enough ether"
        );
        //song.downloads += 1;
        song.owner.transfer(msg.value);

        emit DownloadSong(song.owner, msg.sender, song, date);
    }

    function getSong(string memory songHash) public view returns (Song memory) {
        return songStruct[songHash];
    }

    function getSongs() public view returns (Song[] memory) {
        return allSongs;
    }

    //like song
    function likeSong() public payable {}

    //update song
    function updateSong(
        string memory _Title,
        uint256 _Price,
        string memory _Date,
        string memory _SongHash,
        string memory _oldHash,
        string memory _SongArtist,
        uint256 _GenreId,
        string memory _CoverImage
    ) public payable {
        //songStruct[_oldHash]

        //emit SongUpdated event
        emit SongUpdated(msg.sender, songStruct[_SongHash], _Date);
    }

    //delete Song
    function delSong(
        string memory songHash,
        uint256 index,
        string memory date
    ) public returns (bool success) {
        Song memory song = songStruct[songHash];

        for (uint256 i = index; i < allSongs.length - 1; i++) {
            allSongs[i] = allSongs[i + 1];
        }
        delete allSongs[allSongs.length - 1];
        //delete songStruct[lastHash];
        allSongs.length--;

        emit SongDeleted(song, date);
    }
}
